/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER check_estoq_item
BEFORE INSERT ON loans 
FOR EACH ROW
BEGIN
  IF NOT EXISTS (SELECT 1 FROM items WHERE items.id = NEW.item_id AND items.available >0) THEN
    SIGNAL SQLSTATE '45000'
      SET MESSAGE_TEXT = 'Item não possui exemplares disponíveis.';
  END IF ;
END */;;
